  const onSubmit = (data) => {
    setInfo(data)
    // console.log(info)
  }
  return (
    <div className="App">
      <header className="App-header">
      <form onSubmit={handleSubmit(onSubmit)}>


      <input {...register("name")} />

      <input type='password' {...register("password", { required: true })} />


      <input type="submit" />
    </form>
      </header>
    </div>
  );
}

